uint16_t sample_index = 0;
float qex = 0;
float qey = 0;

static inline uint8_t pdm(void) {
  uint8_t out = 0;

  qex += xs[sample_index];
  qey += ys[sample_index];

  out = ((qex > 0) ? 1 : 0) | ((qey > 0) ? (1 << 1) : 0);

  qex -= (qex > 0) ? 1 : -1;
  qey -= (qey > 0) ? 1 : -1;

  if (sample_index++ >= XS_LENGTH) {
    sample_index = 0;
    qex = 0;
    qey = 0;
  }

  return out;
}

void tim2_isr(void) {
  gpio_port_write(PDM_PORT, pdm());
  timer_clear_flag(TIM2, TIM_SR_CC1IF);
}

static void timer_setup(void) {
  rcc_periph_clock_enable(RCC_TIM2);
  nvic_enable_irq(NVIC_TIM2_IRQ);

  timer_set_mode(TIM2, TIM_CR1_CKD_CK_INT, TIM_CR1_CMS_EDGE, TIM_CR1_DIR_UP);
  timer_set_oc_mode(TIM2, TIM_OC1, TIM_OCM_ACTIVE);

  timer_set_prescaler(TIM2, 4);
  timer_set_period(TIM2, 262-1);

  timer_enable_irq(TIM2, TIM_DIER_CC1IE);
  timer_enable_counter(TIM2);
  timer_enable_oc_output(TIM2, TIM_OC1);
}

static void gpio_setup(void) {
  rcc_periph_clock_enable(RCC_GPIOA);
  gpio_mode_setup(PDM_PORT, GPIO_MODE_OUTPUT, GPIO_PUPD_NONE, PDM_X_PIN | PDM_Y_PIN);
  gpio_set_output_options(PDM_PORT, GPIO_OTYPE_PP, GPIO_OSPEED_100MHZ, PDM_X_PIN | PDM_Y_PIN);
}

int main(void) {
  system_setup();
  gpio_setup();
  timer_setup();

  while(1){}

  return 0;
}
